import React from 'react'

const Main = () =>{
    return(
        <div>
            <h1>Página Principal</h1>
            <p>
            Para criar um usuário no projeto do Firebase, chame o método createUserWithEmailAndPassword ou use um provedor de identidade federado, como o Login do Google ou do Facebook, para fazer o login do usuário pela primeira vez.
            </p>
        </div>
    )
}

export default Main
